import React from "react";
import ReactDOM from "react-dom";
import Highcharts, { color } from 'highcharts';
import HighchartsReact from "highcharts-react-official";
import HighChartsMore from "highcharts/highcharts-more";
import { highmaps } from "highcharts/highmaps";
import "highcharts/modules/variable-pie"

function DevopsChart() {
    HighChartsMore(Highcharts)
    let options = {
        chart:
        {
            type: 'packedbubble',
            height:"310px",
            backgroundColor:'transparent'
        },
        colors: [
            '#fed',
            '#ffddc0',
            '#ecb',
            '#dba',
            '#c99',
            '#b88',
            '#aa7577',
            '#9f6a66'
          ],
        
          xAxis: {
            visible: false
          },
        
          yAxis: {
            visible: false
          },
        
          legend: {
            enabled: false
          },
        //   plotOptions: {
        //     series: {
        //       keys: ['x', 'y', 'name', 'desc'],
        //       tileShape: 'diamond',
        //       dataLabels: {
        //         enabled: true,
        //         format: '{point.name}',
        //         color: '#000000',
        //         style: {
        //           textOutline: false
        //         }
        //       }
        //     }
        //   },
        
          series: [{
           name: 'Docker',
           data:[{value: 200}],
           },
           {
            name: 'Apache Tomcat',
            data:[{value: 150}],
            },
           {
            name: 'AWS',
            data:[{value: 170}],
            },
            {
                name:'Linux',
                data:[{value:190}]
            },
            {
                name:'Agile',
                data:[{value:160}]
            }
        
        ]
    }


    return (
        <span>
      <HighchartsReact 
        highcharts={Highcharts}
        options={options}
      />
    </span>
    )
}

export default DevopsChart;
